package com.ufgov.zc.client.zc.ztb.model;import java.io.Serializable;import java.util.ArrayList;import com.ufgov.zc.client.zc.ztb.model.face.ISmartUserObject;public class BusinessProjects implements ISmartUserObject,Serializable {  private ArrayList<BusinessProject> proList;  public ArrayList<BusinessProject> getProList() {    return proList;  }  public void setProList(ArrayList<BusinessProject> proList) {    this.proList = proList;  }  public BusinessProject getProject(String proNo) {    if (proList == null || proList.size() == 0) {      return null;    }    for (BusinessProject p : this.proList) {      if (p.getNo().equals(proNo)) {        return p;      }    }    return null;  }  public String toString() {    return "项目列表";  }}